import React from 'react'

export default class translateme extends React.Component{
    render(){
        return(
            <div >
                <div class="TranslateMeAbout">
                  <h2 class="translatemeTitle">Translate Me</h2>
                  <p class="translatemeContent">Translate me uses a machine learning technology to classify and translate images into different languages. Once the image is captured, users can flip the image to reveal the desired translated word for the image.</p>

                </div>
            </div>
        )
    }
}
